def all_tickers():
    import pandas as pd
    from yahoo_fin import stock_info as si
    # https://levelup.gitconnected.com/how-to-get-all-stock-symbols-a73925c16a1b

    # gather stock symbols from major US exchanges
    df1 = pd.DataFrame( si.tickers_sp500() )
    df2 = pd.DataFrame( si.tickers_nasdaq() )
    df3 = pd.DataFrame( si.tickers_dow() )
    df4 = pd.DataFrame( si.tickers_other() )

    # convert DataFrame to list, then to sets
    sym1 = set( symbol for symbol in df1[0].values.tolist() )
    sym2 = set( symbol for symbol in df2[0].values.tolist() )
    sym3 = set( symbol for symbol in df3[0].values.tolist() )
    sym4 = set( symbol for symbol in df4[0].values.tolist() )

    # join the 4 sets into one. Because it's a set, there will be no duplicate symbols
    symbols = set.union( sym1, sym2, sym3, sym4 )

    # Some stocks are 5 characters. Those stocks with the suffixes listed below are not of interest.
    my_list = ['W', 'R', 'P', 'Q']
    del_set = set()
    sav_set = set()

    pp3=[]
    pp4=[]
    f2=open('/home/az2/ticker_legit.txt','w+')
    for symbol in symbols:
        if len( symbol ) > 4 and symbol[-1] in my_list:
            del_set.add( symbol )
            pp4.append(symbol)
        else:
            sav_set.add( symbol )
            pp3.append(symbol)
            
            

    print( f'Removed {len( del_set )} unqualified stock symbols...' )
    print( f'There are {len( sav_set )} qualified stock symbols...' )
    print(sav_set,' list of tickers')
    print(del_set,'  list of remove tickers-with isusues')
    f2.write('\n\n')
    f2.write('listed good companies')
    f2.write(str(pp3).strip(' '))
    f2.write('\n\n')
    f2.write('listed bank  companies (bankruptcy, warrants)')
##    f2.write(str(pp4))
    f2.close()
    print("tickers are listed in '/home/az2/ticker_legit.txt'")
    return(pp3,pp4)

